description:
Handmade Tutu with real tulle! (Including our latest new Neon Blue color!)

-With 2 layers of folded soft tulle (equivalent to 4 layers with no rough edges), it is great to wear in parties, photo shoots, dance classes or even just let your little girl to twirl around with.

-Comes in 7 easy to match colors, and in 3 sizes. HKD 328.
Size 1 (1 year and below) - waist: 17 inches, length: 6 inches;
Size 2 (1-3 years old) - waist: 19 inches, length: 7 inches;
Size 3 (3-5 years old) - waist: 22 inches, length: 8.5 inches;

- Skirt should sit above the knee;

- Custom sizes available upon request.
